	//Punkte einf√ºgen & einf√§rben
	var orangeMarker = {
	radius: 8,
	fillColor: "#ff7800",
	color: "#000",
	weight: 1,
	opacity: 1,
	fillOpacity: 0.6
	};
	
	var overlay_eq_points = L.geoJSON(eq_points,  {pointToLayer: function (feature, latlng) {return L.circleMarker(latlng, orangeMarker);
	}}).addTo(mymap);
	
	
	//WMS Layer hinzuf√ºgen
	var overlay_DTK1000 = L.tileLayer.wms("http://sg.geodatenzentrum.de/wms_dtk1000", {
	layers: 'dtk1000',
	format: 'image/png',
	transparent: true,
	attribution: "SG.Geodatenzentrum"
	});
	
	//auch m√∂glich gleich nach der Klammer vorher
	overlay_DTK1000.addTo(mymap)




	//Basemap 1
	var OSM_basemap =
	L.tileLayer('https://{s}.tile.openstreetmap.de/tiles/osmde/{z}/{x}/{y}.png').addTo(mymap);
	
	//Basemap 2
	var OTM_basemap = 
	L.tileLayer('https://{s}.tile.opentopomap.org/{z}/{x}/{y}.png'); 		//addTo nicht n√∂tig da erst geladen wenn online ausgew√§hlt
	
	//Legende einf√ºgen
	var basemaps = {
	"Open Street Map": OSM_basemap,
	"Open Topo Map": OTM_basemap
	};
	
	var overlays = {
	"Earthquakes in Germany": overlay_eq_points,
	"Topo Map 1:1 Mio": overlay_DTK1000};

	var legend = L.control.layers(basemaps, null, {collapsed: false}).addTo(mymap);
	
	var legend = L.control.layers(basemaps, overlays, {collapsed:false}).addTo(mymap);

	// Ma√üstabsleiste
	var scale = L.control.scale({maxWidth: 150, metric: true, imperial: true}).addTo(mymap);

	
	//Marker mit Text
	var markBota = L.marker([48.523540, 9.057540]).addTo(mymap);

	markBota.bindPopup("<p>Das ist der botanische Garten</p>");
